import { service as graphqlService } from '../service/graphql'
import { service as firebaseService } from '../service/firebase'
import { AddCard } from './AddCard'
import { AddTopic } from './AddTopic'
import { GetTopic } from './GetTopic'
import { GetTopics } from './GetTopics'
import { GetTopicsObserver } from './GetTopicsObserver'
import { RemoveTopic } from './RemoveTopic'
import { GetCurrentUser } from './GetCurrentUser'
import { GetUserToken } from './GetUserToken'
import { UserObserver } from './UserObserver'

const addCard = new AddCard(graphqlService)
const addTopic = new AddTopic(graphqlService)
const getCurrentUser = new GetCurrentUser(firebaseService)
const getTopic = new GetTopic(graphqlService)
const getTopics = new GetTopics(graphqlService)
const getTopicsObserver = new GetTopicsObserver(graphqlService)
const getUserToken = new GetUserToken(firebaseService)
const removeTopic = new RemoveTopic(graphqlService)
const userObserver = new UserObserver(firebaseService)

export {
  addCard,
  addTopic,
  getCurrentUser,
  getTopic,
  getTopics,
  getTopicsObserver,
  getUserToken,
  removeTopic,
  userObserver,
}
